import "./App.css";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
//Other Pages
import Home from './homePage/Home';
import SignUp from "./components/signup/signup";
import teacherProject from './teacherProjects/teacherProject';
import gridImages from'./teacherProjects/scratchGrid.jsx';
import ProjectBuilder from './ProjectBuilder1 - Teacher/ProjectBuilder';

function App() {
  return (
    <Router>
    <div className="App">
      <switch>
      <Route path="/" exact component={Home}/>
      <Route path="/SignUp" component={SignUp} />
      <Route path="/teacherProject" component={teacherProject} />
      <Route path='/gridImages' component={gridImages} />
      <Route path='/ProjectBuilder' component={ProjectBuilder} />
      </switch>
    </div>
    </Router>
  );
}

export default App;
